@pytest.fixture
def create_geojson(tmp_path):
    def tmp_geojson(input_geojson):
        fake_geojson = tmp_path / "fake.geojson"
        with fake_geojson.open("w") as fp:
            fp.write(input_geojson)
        return fake_geojson

    return tmp_geojson


def test_geojson_does_not_exist(tmp_path: Path) -> None:
    d: Path = tmp_path / "fake.geojson"
    with pytest.raises(FileNotFoundError):
        geojsplit.GeoJSONBatchStreamer(d)


def test_batch_size_smaller(create_geojson):
    batch_size: int = 2
    tmp_geojson = create_geojson(geojson_str)
    gj: geojsplit.GeoJSONBatchStreamer = geojsplit.GeoJSONBatchStreamer(tmp_geojson)

    for feature_collection in gj.stream(batch=batch_size):
        assert len(feature_collection["features"]) == batch_size


def test_batch_size_leftover(create_geojson):
    batch_size: int = 3
    tmp_geojson = create_geojson(geojson_str)
    gj: geojsplit.GeoJSONBatchStreamer = geojsplit.GeoJSONBatchStreamer(tmp_geojson)
    g = gj.stream(batch=batch_size)
    for feature_collection in g:
        if len(feature_collection["features"]) < batch_size:
            # assuming that if num features less than batch_size
            # it is because we are at end of Iterable
            with pytest.raises(StopIteration):
                next(g)


def test_default_batch_value(create_geojson):
    batch_size = None
    tmp_geojson = create_geojson(geojson_1000_str)
    gj: geojsplit.GeoJSONBatchStreamer = geojsplit.GeoJSONBatchStreamer(tmp_geojson)

    for feature_collection in gj.stream(batch=batch_size):
        assert len(feature_collection["features"]) == 100

